import React from 'react';

const NewCalendar = () => {
    return (
        <div id="monthly-view">
            <div className="day-row">
                {days.map((a, i) => (
                    <div key={i} className="day-cell">
                        {a}
                    </div>
                ))}
            </div>

            {dates.map((a, i) => (
                <div key={i} className="monthly-row">
                    {a.map((b, j) => <MonthlyCell key={j} date={b} schedule={getCurDateSchedule(b)} />)}
                </div>
            ))}
        </div>
    );
};

export default NewCalendar;
